import React from "react";

function Calendar() {
    return (
      <div className="Calendar">
          <iframe src="https://calendar.google.com/calendar/embed?height=600&amp;wkst=1&amp;bgcolor=%23F4511E&amp;ctz=America%2FToronto&amp;src=b2Nkc2IuY2FfdXFta3VnbXNobWRoaXFiNDQwZ3A1dmhkdGdAZ3JvdXAuY2FsZW5kYXIuZ29vZ2xlLmNvbQ&amp;color=%236633CC"  style="border:solid 1px #777" width="750" height="600" frameborder="0" scrolling="no"></iframe>
      </div>
    );
  }

  export default Calendar;
